import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import * as cal from './Heading'
function thePeople () {
     items.map(heading => {
        return (
        <cal.default 
        id = {heading.id}
        name = {heading.name}
        tel = {heading.tel}
        email = {heading.email} />
        )
    })
}
